import './App.css';
import {useState,useEffect} from 'react'
import NavBar from './components/NavBar';
import Post from './components/Post'
import 'bootstrap/dist/css/bootstrap.min.css';
import image from "../src/assets/images/image.jfif";
import CreatePost from './components/CreatePost';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Login from './components/Login';
import Register from './components/Register';
import Profile from './components/Profile'
import Logout from './components/Logout'


function App() {
  var [posts, setPosts] = useState([]);
  var [userposts,setUserposts] = useState([])

    // useEffect(()=>{
    //   let data = localStorage.getItem('post-list')
    //   if(data){
    //     setPosts(JSON.parse(data))
    //   }
    // },[])

    // useEffect(()=>{
    //   localStorage.setItem('post-list',JSON.stringify(posts))
    // })


  return (
    <Router>
    <div className="App">
      <Switch>
       <Route path='/' exact ><NavBar></NavBar><Login></Login></Route>
       <Route path='/register' exact ><Register></Register></Route>
      <Route path='/login' exact ><Login></Login></Route>
      <Route path='/create-post' exact ><NavBar></NavBar><CreatePost posts={posts} setPosts={setPosts} /></Route>
      <Route path='/post' exact ><NavBar></NavBar><Post posts={posts} setPosts={setPosts}></Post></Route>
      <Route path='/profile' exact ><NavBar></NavBar><Profile userposts={userposts} setUserposts={setUserposts}></Profile></Route>
      <Route path='/profile' exact ><Logout></Logout></Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
